Marvel Avengers Game ❤ We start the game on A-Day, a party with several attractions and shops on the Avengers. We play Kamala Khan (future Miss Marvel). You can admire the heroes, chat with fans and play at the attractions. The party will not last long because the reactor created by Tony breaks and lets out a kind of nuclear. Following this there will be many victims and new people with powers (including Miss Marvel). We also learn of Captain America's death and then 5 years pass before the story begins. (I specify that I am at the beginning of the game so I do not know the whole story yet)

